Court finds State has complied with victim notification.  Sentencing hearing proceeded. Statements made as to sentencing.

AS TO COUNT 3: 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 YEARS (CONCURRENT TO CASE 20CF4404), with credit for 114 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 1 YEAR and 6 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 1 YEAR and 6 MONTHS. 

The defendant IS NOT eligible for the Challenge Incarceration Program and IS NOT eligible for the "Wisconsin Substance Abuse Program". 

Court STAYED sentence and placed defendant on PROBATION for 30 MONTHS.
CONDITIONS OF PROBATION AND EXTENDED SUPERVISION:
-Serve 60 DAYS in the House of Correction as Condition Time (as to COUNT 1 on CASE 20CF4404), STAYED pending review;
-Batterers Intervention program;
-Mental health evaluation, comply with recommended treatment;
-AODA assessment, comply with recommended treatment;
-Parenting classes;
-Treatment and/or counseling as determined by agent;
-Absolute sobriety;
-No contact with victim J.K. unless approved by the Court;
-Obtain/maintain employment;
-No contact with firearms;
-Provide DNA sample;
-Pay all supervision fees, court costs, fees, and surcharges including: DNA surcharge during period of probation.  Unpaid amount to convert to a civil judgment.

*Court advised defendant of right to seek post conviction relief.
*Court advised due to felony conviction the defendant is prohibited from firearm possession, and defendant's voting rights are suspended and may not vote until civil rights are restored. 

